  false,\n\t\"url\": null,\n\t\"notes\": \"This is a list of cleanup sites in Washington
  State. It includes sites and associated websites.  It includes location data, Cleanup
  Status, Site Rank u2013 if the site is ranked, and if the site has an Environmental
  Covenant.  rnrnOver half the cleanup sites have a status of u201cNo Further Action
  Required/Decisionu201d or NFA.  If a site has a NFA it includes the latest NFA date
  and NFA reason.  rnrnThe Washington Department of Ecology (Toxics Cleanup Program)
  works to clean up contaminated sites/properties throughout the state of Washington.
  This data was downloaded from the Integrated Site Information System (ISIS) database
  and is monthly.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
